(1, 'จับยี่กี', '88 ครั้ง ต่อรอบ', '<table style=\"border-collapse: collapse; width: 49.111%; height: 246px;\" border=\"1\">\r\n<tbody>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\"><strong>ประเภทหวย</strong></td>\r\n<td style=\"width: 50%; text-align: center;\"><strong>ราคาจ่าย</strong></td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">3 ตัวบน</td>\r\n<td style=\"width: 50%; text-align: center;\">800</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">3 ตัวโต๊ด</td>\r\n<td style=\"width: 50%; text-align: center;\">120</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">2 ตัวบน</td>\r\n<td style=\"width: 50%; text-align: center;\">90</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">2 ตัวล่าง</td>\r\n<td style=\"width: 50%; text-align: center;\">90</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">เลขวิ่ง 3 ตัวบน</td>\r\n<td style=\"width: 50%; text-align: center;\">3.2</td>\r\n</tr>\r\n<tr>\r\n<td style=\"width: 50%; text-align: center;\">เลขวิ่ง 2 ตัวล่าง</td>\r\n<td style=\"width: 50%; text-align: center;\">4.2</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p>**หมายเหตุ ทางเว็ปขอสงวนสิทธิ์ในการระงับ ยูสเซอ ที่จงใจเข้ามาหาผลประโยชน์ ในการยิงเลขของระบบยี่กี่ เพื่อรับรางวัลอันดับที่ 1 และ 16 หรือ จงใจปั่นค่าแนะนำ ถ้าทางเว็ปตรวจพบ จะระงับยูสเซอนั้นในทันที</p>\r\n<ul>\r\n<li><span style=\"font-size: 18px;\">เปิดรับแทงวันละ 88 รอบ ออกผลรางวัลทุกๆ 15 นาที &nbsp;</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">รอบแรกเริ่มเวลา 06:00 น. (เริ่มทายผลได้ตั้งแต่ 05:00 น. ทายผลล่วงหน้าได้ทุกรอบ)</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">ปิดรับแทงรอบสุดท้าย เวลา 03:45 น.</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">สามารถส่งตัวเลขได้ฟรี ไม่จำกัดจำนวนครั้ง ด้วยกติกาที่ชัดเจนและสามารถตรวจสอบได้&nbsp;</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">สมาชิกที่ยิงเลขได้ลำดับที่ 16 จะได้รับ<span style=\"color: #ff0000;\">เครดิต ฟรี 50 บาท และลำดับที่ 1 ฟรี 30 บาท</span>&nbsp;<strong>เงื่อนไขจะต้องมียอดเดิมพันรอบนั้นขั้นต่ำ 100 บาทขึ้นไป</strong></span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">เลขวิ่งบน รับทายผล 3 ตัวบนเหมือนหวยรัฐบาล</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">หากเลขที่สมาชิกร่วมทายผลมีไม่ถึง 20 ลำดับ ไม่ว่าในกรณีใดก็ตาม ทางระบบจะทำการคืนโพยและคืนยอดเงินที่แทงเข้ามาในรอบนั้นทันที&nbsp;</span></li>\r\n</ul>\r\n<ul class=\"ul1\">\r\n<li class=\"li2\"><span style=\"font-size: 18px; line-height: 25.7143px;\"><span style=\"text-decoration: underline; font-weight: bold; color: #ff0000;\">สำคัญ!</span>หากระบบล่มหรือขัดข้องระหว่างก่อนปิดการร่วมส่งทายผลตัวเลขออกรางวัล จนเป็นสาเหตุทำให้สมาชิกไม่สามารถเข้าใช้งานระบบได้ ทางทีมงานจะทำการตัดสินการออกรางวัลตามความเหมาะสม การตัดสินขึ้นอยู่กับดุลพินิจของทีมงาน ทีมงานจะตัดสินด้วยความโปร่งใสและเป็นธรรมที่สุด <span style=\"text-decoration: underline;\">ตัวอย่าง</span> เช่น ก่อนหมดเวลาร่วมส่งผลทายผลตัวเลขออกรางวัล 1 นาที ระบบเกิดปัญหาขัดข้องไม่สามารถเข้าใช้งานได้ ทำให้สมาชิกไม่สามารถเข้ามาร่วมทายผลตัวเลขได้ กรณีนี้ทางทีมงานจะทำการยกเลิกและคืนเงินเครดิตในรอบนั้นทันที ถึงแม้ว่าก่อนหน้านั้นจะมีสมาชิกยิงเลขเข้ามามากกว่า 20 ลำดับก็ตาม</span></li>\r\n</ul>\r\n<p><span style=\"font-size: 18px;\">&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">ออกผลรางวัลโดยการให้สมาชิกทุกๆท่าน ร่วมส่งตัวเลขจำนวน 5 หลัก</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">จากนั้นทางบริษัทฯจะนำตัวเลขที่สมาชิกส่งเข้ามาทั้งหมดในรอบนั้นๆ มารวมกัน</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">แล้วเอาผลรวมที่ได้นำไปลบกับเลข ลำดับที่ 16 ของรอบนั้น และจะนำผลที่ได้มาเป็นผลในการออกรางวัล&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">ตัวอย่างเช่น ผลรวมการยิงเลขทั้งหมด ได้ 2543565 - [34529&nbsp;ตัวอย่างลำดับ 16] = 2509036 &nbsp;&lt;&lt; ผลหลังจากลบลำดับที่ 16&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">ผลรวม 3 ตัวท้าย จะถูกนำมาออกผลรางวัลเป็น เลข 3 ตัวบนของหวยยี่กีรอบนั้น ผลรวมหลักพัน และหลักหมื่น จะถูกนำมาออกผลรางวัลเป็น เลข 2 ตัวล่าง ของหวยยี่กีรอบนั้น&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">ตามตัวอย่างผลรวมหลังลบลำดับที่ 16 ได้ = 25<span style=\"background-color: yellow;\">09</span><span style=\"background-color: #ff0000;\">036</span> = เลขที่ออก 3 ตัวบนคือ = <span style=\"background-color: #ff0000;\">036</span> เลขที่ออก 2 ตัวล่างคือ = <span style=\"background-color: yellow;\">09</span>&nbsp;</span></p>\r\n<p><span style=\"font-size: 18px;\">&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"color: #ff0000; font-size: 18px;\">สมาชิกที่ยิงเลขได้ลำดับที่ 16 จะได้รับเครดิต ฟรี 50 บาท&nbsp;</span></p>\r\n<p class=\"p2\"><span class=\"s1\" style=\"color: #ff0000; font-size: 18px;\">พิเศษ !!&nbsp;</span><span style=\"color: #ff0000; font-size: 18px; line-height: 34.2857px;\">สมาชิกที่ยิงเลขได้ลำดับที่ 1 จะได้รับเครดิต ฟรี 30 บาท&nbsp;</span></p>\r\n<p class=\"p4\"><strong><span class=\"s1\" style=\"font-size: 18px;\">เงื่อนไขจะต้องมียอดเดิมพันรอบนั้นขั้นต่ำ 100 บาทขึ้นไป&nbsp;</span></strong></p>\r\n<p><span style=\"font-size: 18px;\">&nbsp;</span></p>\r\n<p><span class=\"s1\" style=\"font-size: 18px;\">ตัวอย่าง เช่น ยี่กีรอบที่ 1 ระบบปิดรับแทงเวลา 06:00 น. ระบบยิ่งเลขจะสามารถยิงเลขได้จนถึงเวลา 06:02 น ต่อไประบบจะทำการตรวจโพยในเวลา 06:03 น. และจะจ่ายเงินสมาชิกทั้งหมดเสร็จภายในเวลาไม่เกิน 06:08 น.&nbsp;</span></p>\r\n<p><span style=\"font-size: 18px;\">หมายเหตุ โปรดตั้งเวลาของอุปกรณ์เข้าเล่นของท่านให้ตรงกับเวลาในเว็บ&nbsp;เพื่อที่ท่านจะได้ไม่สับสนกับเวลาปิดรับ เวลาที่แสดงผลการส่งตัวเลขจะใช้เวลาจากเชิฟเวอร์จริง</span></p>\r\n<p><span style=\"font-size: 18px;\">&nbsp;</span></p>', 'yeekee/index', '24 ชั่วโมง', 1, '2019-02-27 05:45:00', 1, '2020-01-24 23:05:29', 1, 'yeekee_rumruay', '1', '7318bfe7be040b367fd04177c352caec.png'),
(2, 'ดำแดง', 'ทุก 2 นาที', '<ul>\r\n<li><span style=\"font-size: 18px;\">เปิดรับแทงวันละ 650 รอบ ออกผลรางวัลทุกๆ 2 นาที &nbsp;</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">รอบแรกเริ่มเวลา 06:00 น.</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">ปิดรับแทงผลทุกๆ 1.30 นาที</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">ออกผลภายใน 30 วินาที หลังจากปิดรับแทง</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">สามารถร่วมทายผลโดยเลือกแดงหรือดำ</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">วางเดิมพันเริ่มต้น 1-2500 บาท</span></li>\r\n<li><span class=\"s1\" style=\"font-size: 18px;\">ใน 1 รอบลูกค้าสามารถแทงได้ 1 โพย (ถ้าต้องการแก้ไขโพยลูกค้าต้องยกเลิกโพยเก่าก่อน)</span></li>\r\n</ul>\r\n<ul class=\"ul1\">\r\n<li class=\"li2\"><span style=\"font-size: 18px; line-height: 25.7143px;\"><span style=\"text-decoration: underline; font-weight: bold; color: #ff0000;\">อัตราจ่าย<br /></span>ดำ จ่าย 1:1 เช่น เดิมพัน 1 บาท ได้ 1 บาท เดิมพัน 50 บาท ได้ 50 บาท เดิมพัน 100 บาท ได้ 100 บาท<br />แดง จ่าย 1:0.95 เช่น เดิมพัน 1 บาท ได้ 0.95 บาท เดิมพัน 50 บาท ได้ 47.5 บาท เดิมพัน 100 บาท ได้ 95 บาท</span></li>\r\n</ul>', '#', '24 ชั่วโมง', 0, '2019-02-27 05:45:00', 1, '2019-07-02 11:47:11', 1, '2', '3', 'e0a9a2ec75a311bd21772847a3c7a70e.jpg'),
