(2, 'กติกาการแจ้งฝากเงิน', '<p><span style=\"color: #e03e2d;\"><strong>วิธีเติมเงิน</strong></span><br />สามารถเติมเงินได้หลังจากระบบอนุมัติผ่าน บัญชีของท่านเเล้ว</p>\r\n<p>1. เลือกธนาคารปลายทางที่ท่านต้องการเติมเงิน&nbsp;</p>\r\n<p>2. ท่านต้องโอนเงินให้เสร็จสิ้นด้วยตัวท่านเองผ่านช่องท่างที่ท่านต้องการเสียก่อน</p>\r\n<p>- โอนเงินขั้นต่ำครั้งละ 20 บาท</p>\r\n<p>- ถ้าโอนต่ำกว่า 20 บาท เงินของท่านจะไม่เข้าระบบเเละไม่สามารถคืนได้</p>\r\n<p>- กรุณาใช้บัญชีที่ท่านผู้กกับ ToYou999.Com ในการโอนเงินเท่านั้น</p>\r\n<p>- เก็บสลิปการโอนเงินไว้ทุกครั้งเมื่อท่านทำการโอนเสร็จสิ้นเเล้ว</p>\r\n<p>3. เมื่อโอนเงินเเล้ว ให้ระบุข้อมูลการโอนเงินของท่าน</p>\r\n<p>- เลือกธนาคารของท่านที่ลงทะเบียนกับ ToYou999.Com</p>\r\n<p>- เลือกช่องทางการโอนเงินของท่าน</p>\r\n<p>- ใส่จำนวนเงินที่โอนเข้ามาตามสลิปของท่าน</p>\r\n<p>- เลือก \"วัน/เดือน/ปี\" ที่ท่านโอนเงินเข้ามาตามสลิปโอนเงิน</p>\r\n<p>- เลือก \"เวลา\" ที่ท่านโอนเงินเข้ามาตามสลิปโอนเงิน</p>\r\n<p>4. กด \"ยืนยันการเเจ้งโอนเงิน\" เเละ รอระบบประมวณผลไม่เกิน 5 นาที</p>\r\n<p>5. ท่านสามารถตรวจสอบยอดเงินของท่านได้ที่เมนูเครดิตด้านบนหรือหน้าหลัก ToYou999.Com</p>\r\n<p>6. สามารถเพิ่มบัญชีธนาคารอื่น เพิ่มเติมได้ที่เมนูด้านบน \"บัญชีธนาคาร\"</p>\r\n<p>7. สามารถเช็ครายการฝาก/ถอนทั้งหมดในบัญชีของท่านได้ที่เมนู \"รายการเเจ้งฝาก/ถอน\"</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #e03e2d;\"><strong>วิธีเเทงหวย</strong></span><br />1. เลือกหวยที่ท่านต้องการจะเเทง</p>\r\n<p>2. เลือก \"กดเลขเอง\" หรือ \"เลือกจากเเผง\" เเละเลือกประเภทเเละตัวเลขที่ต้องการ</p>\r\n<p>กดเลขเอง : กดเลขบนปุ่มหน้าจอ 0 - 9 ทีละตัวเลข เพื่อระบุเลขที่ท่านต้องการลงไป</p>\r\n<p>เลือกจากเเผง : เลือกเลขที่ท่านต้องการบนเเผงได้เลยมีตั้งเเต่ 0 - 999</p>\r\n<p>- เลือกประเภทเลขที่ท่านต้องการจะเล่นเช่น 3ตัวบน 2ตัวล่าง 3ตัวโต๊ด เป็นต้น</p>\r\n<p>- เลขที่ท่านเลือกจะเเสดงอยู่ด้านซ้ายเเละด้านบนในเมนู รายการเเทง</p>\r\n<p>- ท่านสามารถ ดึงเลขที่ท่านต้องการได้เลยโดยเลือกที่ปุ่ม \"ดึงโพย\"</p>\r\n<p>- ท่านสามารถ ลบเลขทั้งหมดในรายการเเทงโดยการเลือกที่ปุ่ม \"ล้างข้อมูล\"</p>\r\n<p>- ท่านสามารถ ลบเลขล่าสุดที่เลือกไปด้วยการเลือกที่ปุ่ม \"ยกเลิกล่าสุด\"</p>\r\n<p>3. เมื่อระบุประเภทเเละเลขที่ท่านต้องการจะเล่นเเล้วให้กดที่ปุ่ม \"ใส่ราคา\"</p>\r\n<p>4. ระบบจะเเสดงรายละเอียดเลขที่เล่น อัตราการได้รับ ยอดคงเหลือ เเละ ยอดเเทงทั้งหมด</p>\r\n<p>5. ท่านสามารถเเก้ไขราคา ดูเลขซ้ำ หรือ ตัดเลขซ้ำ ตามต้องการได้ทันที</p>\r\n<p>6. ตรวจสอบข้อมูลโพยของท่านเรียบร้อยเเล้วให้เลือกที่ปุ่ม \"ส่งโพย\"</p>\r\n<p>7. กด \"ยืนยนัการส่งโพย\" ของท่านอีกครั้ง ระบบจะเเสดงรายละเอียดข้อมูลการเเทงของท่าน ท่านสามารถเลือก บันทึกโพยเป็นรูปภาพหรือตรวจสอบประวัติโพยที่เเทงไปก่อนหน้านี้ หรือ เเทงต่อ ได้เลยที่เมนูหน้านี้</p>\r\n<p>8. ท่านสามารถตรวจสอบสถานะโพยหวยของท่านได้ที่เมนู \"โพยหวย\"</p>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #e03e2d;\"><strong>วิธีถอนเงิน</strong></span><br />สามารถถอนเงินได้หลังจากระบบอนุมัติผ่าน บัญชีของท่านเเล้ว</p>\r\n<p>1. ระบุจำนวนเงินที่ท่านต้องการจะถอน หรือ กดทั้งหมด เพื่อถอนเงินออกทั้งหมด</p>\r\n<p>- ถอนเงินขั้นต่ำ 100 หรือ สูงสุด 200,000 บาท</p>\r\n<p>2. กด \"ถอนเงิน\" ระบบจะทำการประมวณผลยอดเงินที่ท่านต้องการเงินออก</p>\r\n<p>3. เงินที่ท่านกด \"ถอนเงิน\" ออกจากถูกโอนเข้าบัญชีที่ลงทะเบียนกับ ToYou999.Com ไว้อัตโนมัติ</p>\r\n<p>4. สามารถเพิ่มบัญชีธนาคารอื่น เพิ่มเติมได้ที่เมนูด้านบน \"บัญชีธนาคาร\"</p>\r\n<p>5. สามารถเช็ครายการฝาก/ถอนทั้งหมดในบัญชีของท่านได้ที่เมนู \"รายการเเจ้งฝาก/ถอน\"</p>\r\n<p>&nbsp;</p>', 1, 'rule', 1, '2019-02-27 05:45:00', 1, '2021-10-31 23:59:21', 1),
