(14823, 26, NULL, '2021-10-31 06:00:00', '2021-10-31 17:00:00', 55, 1, 9, '2021-10-31 06:00:02', '2021-10-31 19:16:48', 'เวียดนาม/ฮานอย (พิเศษ)', 2, '<div><p><strong>1. ระบบ เปิดรับแทงทุกวัน ออกผลทุกวัน(ปิดรับแทงตามวันหยุดหวยเวียดนาม)&nbsp;</strong></p><p><strong>2. ระบบ เปิดรับแทงตั้งแต่เวลา 06:00 น.&nbsp;&nbsp;</strong></p><p><strong>3. ระบบ ปิดรับแทงเวลา 18:10 น.</strong></p></div><p>&nbsp;</p><p><strong>ตาราง ราคาจ่ายที่ให้คุณมากกว่าใคร</strong></p><div id=\"\"\"\" class=\"\"\"\" title=\"\"\"\" data-exact-height=\"\"\"\" data-content-padding-horizontal=\"\"\"\" data-content-padding-vertical=\"\"\"\" data-state=\"\"\"\" data-reactid=\"\"\"\"><div id=\"\"\"\" class=\"\"\"\" data-reactid=\"\"\"\"><p>3 ตัวบน ราคาจ่าย 750 บาท</p><p>3 ตัวโต๊ด ราคาจ่าย 120 บาท</p><p>2 ตัวบน &ndash; ล่าง ราคา 90 บาท</p><p>เลขวิ่ง 3 ตัวบน ราคา 3.2 บาท</p><p>เลขวิ่ง 2 ตัวล่าง ราคา 4.2 บาท</p></div></div><div id=\"\"\"\" class=\"\"\"\" title=\"\"\"\" data-exact-height=\"\"\"\" data-content-padding-horizontal=\"\"\"\" data-content-padding-vertical=\"\"\"\" data-state=\"\"\"\" data-reactid=\"\"\"\">&nbsp;</div>', 1, NULL, 1),
