(14874, 33, NULL, '2021-11-02 06:00:00', '2021-11-04 19:45:00', 55, 1, 1, '2021-11-02 06:00:02', '2021-11-02 06:00:02', 'หวยลาวชุด 120', 2, '<p>&nbsp;</p><table width=\"\"\"\"><tbody><tr><td><strong>&nbsp;ประเภทหวย</strong></td><td><strong>&nbsp;ราคาจ่าย</strong></td></tr><tr><td>&nbsp;4 ตัวตรง</td><td>&nbsp;125,000</td></tr><tr><td>&nbsp;4 ตัวโต๊ด</td><td>&nbsp;5,500</td></tr><tr><td>&nbsp;3 ตัวตรง</td><td>&nbsp;41,000</td></tr><tr><td>&nbsp;3 โต๊ด</td><td>&nbsp;4,100</td></tr><tr><td>&nbsp;3 ตัวหน้า</td><td>&nbsp;1,800</td></tr><tr><td>&nbsp;2 ตัวหน้า</td><td>&nbsp;1,600</td></tr><tr><td>&nbsp;2 ตัวหลัง</td><td>&nbsp;1,600</td></tr><tr><td>&nbsp;</td><td>&nbsp;</td></tr></tbody></table><p>การออกรางวัลออก \"\"\"\"\"\"\"\"ทุกวันจันทร์ และ พฤหัส ของทุกสัปดาห์\"\"\"\"\"\"\"\" ปิดรับแทงเวลา 19.45 น. หวยออก 20.30 น.<br />หวยลาวชุดไม่ว่าจะออก 4 หรือ 5 ตัว ให้ นำเลข 4 ตัวหลังเป็นหลัก<br />ตัวอย่างเช่น<br />รางวัล 4 ตัว ผลออก 1234<br />4 ตัวตรง คือ 1234<br />3 ตัวตรง คือ 234<br />3 ตัวหน้า คือ 123<br />4 ตัวโต๊ด คือ 1234,1324,1423,... x4x16<br />3 ตัวโต๊ด คือ 234 243 324 342 432 423<br />2 ตัวหน้า คือ 12<br />2 ตัวหลัง คือ 34<br />รับรางวัลสูงสุดได้เพียง 1 รางวัล เราจะเลือกรางวัลที่ได้รางวัลสูงสุดให้ลูกค้าอัตโนมัติ</p><p>&nbsp;</p><p>&nbsp;</p>', 1, NULL, 1),
